import React from 'react';
import { useSelector } from 'react-redux';

function Cart(props) {
    const productCart = useSelector(state => state.cart); //to get the state
    return (
        <>
            <h1>Cart</h1>
            <div className='container'>
                <div className='row'>
                    <div className='col-4 mb-5' >
                        <div className="card text-center"  style={{ width: "18rem", height:"300px"}}>
                            <img src='...' className="card-img-top mt-3" alt="..." style={{ width: "100px", height: "130px", textAlign: 'center', margin: 'auto'}}/>
                            <div className="card-body">
                                <h5 className="card-title" style={{ fontSize: '14px'}}>title</h5>
                                <p className="card-text">Rs.</p>
                                <button href="#" className="btn btn-primary" >Remove</button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Cart;
